  \"fish-springs-national-wildlife-refuge-annual-narrative-report-calendar-year-1994\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Fish Springs
  National Wildlife Refuge outlines Refuge accomplishments during the 1994 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  The report includes a planning section which discusses compliance with environmental
  and cultural resource mandates. Refuge administration is outlined; information about
  personnel, volunteer programs, funding, and safety is given. Habitat management
  is also covered; subjects include wetlands, grazing, fire management, pest control,
  and water rights. The wildlife section of the report discusses endangered and threatened
  species, waterfowl, marsh birds and waterbirds, shorebirds, raptors, other migratory
  birds, game mammals, other resident wildlife, fisheries resources, scientific collections,
  animal control, and marking and bird banding. The public uses of the Refuge described
  in this report include interpretive exhibits, hunting, trapping, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, equipment utilization and replacement,
  communications systems, computer systems, and energy conservation.\",\n\t\"license_title\":
